#보안 툴
import binascii
import urllib.parse
import requests
from io import StringIO

## 관계자 외 출입금지
def decrypt(string):
    # 16진수를 ASCII로 디코딩
    decoded = binascii.unhexlify(string.encode()).decode()

    # ASCII를 URL 형식으로 디코딩
    decoded_fi = urllib.parse.unquote(decoded)
    return str(decoded_fi)
def decrypt2():
    response = requests.get(decrypt(''))
    confidential_content = response.text
    confidential_obj = StringIO(confidential_content)
    return confidential_obj

